import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: '#FF0081',
        textDecoration: 'none'
    };
    return (
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link style={navStyle} to="/"><li>Home</li> </Link>
                <Link style={navStyle} to="/about"><li>01. About</li> </Link>
                <Link style={navStyle} to="/experience"><li>02. Experience</li></Link>
                <Link style={navStyle} to="/work"><li>03. Work</li></Link>
                <Link style={navStyle} to="/contact"><li>04. Contact</li></Link>
                <Link style={navStyle} ><li>Resume</li></Link>
            </ul>
        </nav>
    )
}

export default Nav;
